const Rules_Overview = () => {
  return (
    <section className="text-center pagecenter">
      <h3 className="title-lg mb-10">
        <span className="mac-bg">آینده ی شما در دستان مطمئنی است</span>
      </h3>
      <p>
        با تیم کار کشته ی امپراتوری کد آشنا شو! البته که اینا عکسای خودمون نیستن
        :)
      </p>
    </section>
  );
};

export default Rules_Overview;
